import Head from 'next/head'
import Menu from '../components/menu';

export default function Ditastore() {
    return (
        <div>
            <Head>
                <title>Life Asuransi</title>
            </Head>
            <Menu />
                <div>
                    <h1>Life Asuransi</h1>
                    <h4>jasa asuransi untuk semua kalangan
                        mulai dari kesehatan jiwa, penyakit kritis dan 
                        asuransi sayariah
                    </h4>

                </div>
        </div>
    );
}
